import React from "react";
import { Result, Button } from "antd";

const Notfound = () => (
  <>
    <Result
      status="404"
      title="404"
      subTitle="Sorry, the page you visited does not exist."
      extra={
        <Button type="primary" href="/">
          Back Home
        </Button>
      }
    />
  </>
);
export default Notfound;
